import React from 'react';
import Button from './Button';
import '../style/style.css';
import logoC from '../rs/langageC.png';
import logoReact from '../rs/logo512.png';
import logoHtml from '../rs/htmllogo.png';
import logoCSS from '../rs/csslogo.png';
import logoNodeJS from '../rs/nodeJSlogo.png';
import logoCpp from '../rs/cpplogo.png';
import logoDocker from '../rs/dockerlogo.png';
import github from '../rs/githublogo.png';
import logoUnreal from '../rs/unreallogo.png';

const Square = ({ title, image }) => {
  return (
    <div className='SkillSquare'>
      <h1>{ title }</h1>
      <img src={image} alt="SquareImage"/>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <main className='HomeBody'>
        <Button text="COMPÉTENCES" />
        <div className='SkillsText'>
          <p>Vous verrez donc sur cette page les compétences que <br /> j'ai pu acquérir en étudiant à Epitech.</p>
        </div>
      </main>
      <div className='SkillsSquares'>
        <br /><br /><br /><br />
        <div className='SkillsSquares1'>
          <Square title="Langage de programmation C" image={logoC} />
          <Square title="React" image={logoReact} />
          <Square title="HTML" image={logoHtml} />
        </div>
        <div className='SkillsSquares2'>
          <Square title="CSS" image={logoCSS} />
          <Square title="NodeJS" image={logoNodeJS} />
          <Square title="C++" image={logoCpp} />
        </div>
        <div className='SkillsSquares3'>
          <Square title="Docker" image={logoDocker} />
          <Square title="GitHub" image={github} />
          <Square title="Unreal Engine" image={logoUnreal} />
        </div>
        <br /><br /><br /><br />
      </div>
    </div>
  );
}

export default App;
